import * as React from "react";


import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Divider from "@mui/material/Divider";
import Typography from "@mui/material/Typography";
import IconButton from "@mui/material/IconButton";
import Box from "@mui/material/Box";
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';

import LockIcon from "@mui/icons-material/Lock";
import HistoryIcon from "@mui/icons-material/History";
import sso from "../sso.png";
import LogoutIcon from '@mui/icons-material/Logout';
import Avatar from '@mui/material/Avatar';
import PersonIcon from '@mui/icons-material/Person';

export default function Header() {
  const [open, setOpen] = React.useState(false);
  const [password, setPassword] = React.useState();
  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };
  const [date, setDate] = React.useState(new Date());
  React.useEffect(() => {
    const timer = setInterval(() => {
      setDate(new Date());
    }, 1000*30);
    return () => {
      clearInterval(timer);
    };
  }, []);
  const day = date.toLocaleDateString("th-TH", {
    year: "numeric",
    month: "long",
    day: "numeric",
  });
  const time = date.toLocaleString("th-TH", {
    hour: "numeric",
    minute: "numeric",
  });
  const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
    var  id =localStorage.getItem("id");

    const jsonData = {
  password: data.get("password"),
          id: id,
    };
    async function postJSON(jsonData) {
      try {
        const response = await fetch("http://localhost:3333/updatepassword", {
          method: "POST", // or 'PUT'
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify(jsonData),
        });

        const result = await response.json();
        console.log(result);
      } catch (errr) {}
    }
    postJSON(jsonData);
  }

  return (
    <AppBar potion="static" sx={{ zIndex: (theme) => theme.zIndex.drawer + 1 }}>
      <Toolbar variant='dense'>
        <Typography variant="body2">{day}</Typography>

        <Divider
          orientation="vertical"
          flexItem="true"
          variant="middle"
          light
          sx={{ margin: 2 }}
        />

        <Typography sx={{ flexGrow: 1 }} variant="body2"> {time} น.</Typography>
        <IconButton color="inherit" onClick={handleClickOpen}>
          <LockIcon />
          <Typography variant="body2">เปลี่ยนรหัสผ่าน</Typography>
        </IconButton>
        <Box component="form" noValidate onSubmit={handleSubmit}>
        <Dialog open={open} onClose={handleClose}>
        <DialogTitle>เปลี่ยนรหัสผ่าน</DialogTitle>
        <DialogContent>
          <DialogContentText>

          </DialogContentText>
          <TextField
            autoFocus
            name="password"
            margin="dense"
            id="password"
            label="รหัสผ่านใหม่"
            type="password"
            fullWidth
            variant="standard"
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>ยกเลิก</Button>
          <Button type="submit" onClick={() => {
                    handleClose();
                    handleSubmit();
                  }}>เปลี่ยรหัสผ่าน</Button>
        </DialogActions>
      </Dialog>
      </Box >
        <Divider
          orientation="vertical"
          flexItem="true"
          variant="middle"
          light
          sx={{ margin: 2 }}
        />
        <IconButton color="inherit">
          <HistoryIcon />
          <Typography variant="body2">ประวัติการใช้งานระบบ</Typography>
        </IconButton>
      </Toolbar>
      <Toolbar variant='dense'
        sx={{
          backgroundColor: "#ffffff",
        }}
      >
        {" "}
        <img src={sso} width="70" height="70" />
        <Box sx={{ flexGrow: 1 }}>
          <Typography color="black">ระบบรับเรื่องร้องเรียน</Typography>
          <Typography color="gray" variant="subtitle2" >
            สำนักงานประกันสังคม
          </Typography>
        </Box>
        <Box sx={{ p: 1,}}>
          <Typography color="black" align="right">เจ้าหน้าที่</Typography>
         <IconButton edge='end'>
        <LogoutIcon/><Typography variant="subtitle2" >
          ออกจากระบบ
        </Typography>
         </IconButton>
        </Box>
        <Avatar sx={{ width: 56, height: 56 }}>
          <PersonIcon/>
        </Avatar>
      </Toolbar>
    </AppBar>
  );
}
